import React from 'react'
import '../css/mainContent.css'

class ReviewTableItem extends React.Component {

    constructor(props){
        super(props)
        console.log(props)
    }

    render(){
        return(            
            <tr>
                <td>{this.props.type}</td>
                <td>{this.props.name}</td>
                <td>${this.props.balance}</td>
            </tr>
        )
    }
}

export default ReviewTableItem
